/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Fragment } from 'react'
import { Playground, Props } from 'docz'
import styled from 'styled-components'
import Menu from './Menu'
import Container from '../Container/Container'
import { ThemeProvider } from '../ThemeContext'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "menu"
    }}>{`Menu`}</h1>
    <Props of={Menu} mdxType="Props" />
    <h2 {...{
      "id": "default"
    }}>{`Default`}</h2>
    <Playground __position={1} __code={'<ThemeProvider>\n  <Menu uid=\"menu1\" label=\"Menu\">\n    <Container\n      padding=\"default\"\n      elevate={3}\n      css=\"background: #fff; color:#000\"\n    >\n      <ul>\n        <li>Item 1</li>\n        <li>Item 2</li>\n        <li>Item 3</li>\n        <li>Item 4</li>\n      </ul>\n    </Container>\n  </Menu>\n</ThemeProvider>'} __scope={{
      props: this ? this.props : props,
      Fragment,
      Playground,
      Props,
      styled,
